import React from "react";

const Test = () => {
  const [input, setInput] = useState({
    email: "",
    password: "",
  });

  const handleClick = () => {
    setInput(input);
    localStorage.setItem("user", JSON.stringify(input));

    const getUser = localStorage.getItem("user");

    // 다시 Object로 변환
    console.log(JSON.parse(getUser));
  };
  return (
    <div>
      <input
        type="text"
        onChange={() => setInput((prev) => (email: e.target.value))}
      />
      <input
        type="text"
        onChange={() => setInput((prev) => (password: e.target.value))}
      />
      <button onClick={handleClick}>localstorage</button>
    </div>
  );
};

export default Test;
